import React from 'react'

const CheckBox = props => {
	return (
		<div className="form-group">
      <label className="checkbox-inline">
        <input 
        	type="checkbox" 
        	id="inlineCheckbox" 
        	name={props.name}
        	value={props.value}
        	onChange = {props.handleChange}
        /> I agree with the terms and conditions.
      </label>
    </div>
		)
}

export default CheckBox;
